CREATE TABLE IF NOT EXISTS public.crete_municipalities
(
    ogc_fid SERIAL NOT NULL,
    id_0 NUMERIC(10,0),
    iso VARCHAR,
    name_0 VARCHAR,
    id_1 NUMERIC(10,0),
    name_1 VARCHAR,
    id_2 NUMERIC(10,0),
    name_2 VARCHAR,
    id_3 NUMERIC(10,0),
    name_3 VARCHAR,
    ccn_3 NUMERIC(10,0),
    cca_3 VARCHAR,
    type_3 VARCHAR,
    engtype_3 VARCHAR,
    nl_name_3 VARCHAR,
    varname_3 VARCHAR,
    wkb_geometry geometry,
    CONSTRAINT crete_municipalities_pkey PRIMARY KEY (ogc_fid)
);
CREATE INDEX "crete_municipalities_wkb_geometry_geom_idx" ON "public"."crete_municipalities" USING GIST ("wkb_geometry");
